import React from 'react';

const MapSection = () => {
  return (
    <section className="py-16 bg-gray-100">
      <div className="max-w-6xl mx-auto px-4 text-center">
        <h2 className="text-4xl font-bold text-gray-900 mb-8">Encuéntranos</h2>
        <div className="aspect-w-16 aspect-h-9 w-full rounded-lg overflow-hidden shadow-lg">
          <iframe
            src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3603.0000000000005!2d-57.14888888888889!3d-25.399999999999995!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x945c2b0000000001%3A0x0!2sCaacup%C3%A9%2C%20Paraguay!5e0!3m2!1sen!2sus!4v1678901234567!5m2!1sen!2sus"
            width="100%"
            height="450"
            style={{ border: 0 }}
            allowFullScreen=""
            loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"
            title="Ubicación de Kiki LBK Barbería en Caacupé"
          ></iframe>
        </div>
      </div>
    </section>
  );
};

export default MapSection;
